import collections

from sortedcontainers import SortedList


class Solution:
    def getModifiedArray(self, length: int, updates):
        out = [0] * length
        for start, end, inc in updates:
            out[start] += inc
            if end + 1 < length:
                out[end + 1] -= inc

        for i in range(1, length):
            out[i] = out[i - 1] + out[i]

        return out

