    def getModifiedArray(self, length: int, updates):
        diffs = collections.defaultdict(int)

        for s, e, d in updates:
            diffs[s] += d
            diffs[e + 1] -= d

        out, s = [0] * length, 0
        for i in range(0, length):
            s = s + diffs[i]
            out[i] = s

        return out





